import { Route } from 'react-router-dom'
import CouponsCustomerSidebar from './CouponsCustomerSidebar/CouponsCustomerSidebar'


export default function Coupons() {
    return (
        <div className="Coupons">
            <Route path="/customer/coupons">
                <CouponsCustomerSidebar />
            </Route>
        </div>)
}
